import './MenuPanel.css';

const MenuPanel = (() => {
  return (
    <div className="menu-panel">
      <button className="refresh"><img src='RefreshItem.svg' alt="refresh"/></button>
      <button className="add"><img src='AddItem.svg' alt="refresh"/></button>
    </div>
  )
})

export default MenuPanel;
